import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { useAuthr } from '../Login/peticion';


function Profile(){
    const auth=useAuthr();
    console.log("un profile",auth.user)
    return(
    <Container>
        <Row>
            <Col>
            <ul class="list-group ">
  <li class="list-group-item bg-dark text-light">Cras justo odio</li>
  <li class="llist-group-item bg-dark text-light" >Dapibus ac facilisis in</li>
  <li class="list-group-item bg-dark text-light">Morbi leo risus</li>
  <li class="list-group-item bg-dark text-light">Porta ac consectetur ac</li>
  <li class="list-group-item bg-dark text-light">Vestibulum at eros</li>
</ul>
            </Col>

            <Col>
            <h2>Lado b </h2>
            </Col>
        </Row>
    </Container>
    )
}

export {Profile}
